/* eslint-disable react-hooks/rules-of-hooks */
import React, { useState, useEffect } from "react";
import {
    Button,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    FormGroup,
    Form,
    Input,
    Row,
    Col,
    Label
} from "reactstrap";
import { useLocation, useNavigate } from "react-router-dom";
import PerfectScrollbar from "perfect-scrollbar";
import Navbar from "components/Navbars/Navbar.js";
import Footer from "components/Footer/Footer.js";
import Sidebar from "components/Sidebar/Sidebar.js";
import axios from "axios";
import jwt from 'jsonwebtoken';
import routes from "user-routes";

var ps;

function Support(props) {
    const [userData, setUserData] = useState();
    const [email, setEmail] = useState();
    const [ticket, setTicket] = useState();
    const [description, setDescription] = useState();
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();

        const supportData = {
            email,
            ticket,
            description,
            userId: userData.userId, // Pass userId from the decoded token
        };

        axios.post('http://localhost:3001/user/support', supportData)
            .then(res => {
                alert('Support Made');
                navigate('/user/support');
            })
            .catch(err => console.log(err));
    };

    useEffect(() => {
        const token = localStorage.getItem('token') || document.cookie.replace(/(?:(?:^|.*;\s*)token\s*=\s*([^;]*).*$)|^.*$/, "$1");

        if (token) {
            const decoded = jwt.decode(token);
            setUserData(decoded);
        }
    }, []);

    return (
        <>
            <div className="wrapper">
               
                <Row>
                    <Col md="8" style={{ margin: 'auto' }}>
                        <Card className="card-user">
                            <CardHeader>
                                <CardTitle tag="h5">Submit Support Ticket</CardTitle>
                            </CardHeader>
                            <CardBody>
                                <Form onSubmit={handleSubmit}>
                                    <Row>
                                        
                                    </Row>
                                    <Row>
                                        <Col md="12">
                                            <FormGroup>
                                                <label>Email</label>
                                                <Input
                                                    type="text"
                                                    placeholder="Email"
                                                    onChange={(e) => setEmail(e.target.value)}
                                                />
                                            </FormGroup>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Col md="12">
                                            <FormGroup>
                                                <label>Ticket Title</label>
                                                <Input
                                                    type="text"
                                                    placeholder=""
                                                    onChange={(e) => setTicket(e.target.value)}
                                                />
                                            </FormGroup>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Col md="12">
                                            <FormGroup>
                                                <label>Ticket Description</label>
                                                <Input
                                                    type="textarea"
                                                    placeholder=""
                                                    onChange={(e) => setDescription(e.target.value)}
                                                />
                                            </FormGroup>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <div className="update ml-auto mr-auto">
                                            <Button
                                                className="btn-round"
                                                color="primary"
                                                type="submit"
                                            >
                                                Submit Ticket
                                            </Button>
                                        </div>
                                    </Row>
                                </Form>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </div>
            <Footer fluid />
        </>
    );
}

export default Support;
